import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import TP1 from "./TP1";
import { Link } from "react-router-dom";
import Personal_1_logout from "./Personal-1-logout";
import Alertp1 from "./Alert-p1";
import Clock from "./Clock";
import BarChart from "./BarChart";
import DeleteAccount from "./deleteaccount";

function Home1() {
  const navigate = useNavigate();

  const [loggedIn, setLoggedIn] = useState(false); // State to manage login status
  const [username, setUsername] = useState(""); // State to store the username

  // Check if user is logged in on component mount
  useEffect(() => {
    const userID = localStorage.getItem("userID");
    const storedUsername = localStorage.getItem("username");
    if (userID) {
      setLoggedIn(true);
      setUsername(storedUsername); // Set the username state
    } else {
      navigate("/");
    }
  }, []);

  const Logout = () => {
    window.localStorage.removeItem("userID");
    window.localStorage.removeItem("username"); // Remove username from localStorage
    setLoggedIn(false);
    navigate("/");
  };

  return (
    <div className="all-home">
      {loggedIn ? (
        <h4>Welcome, {userID}!</h4> // Render welcome message with username if logged in
      ) : (
        <button onClick={() => navigate("/login")}>Log in</button>
      )}

      <div className="allbuttons">
        {loggedIn && (
          <button className="buttons" onClick={Logout}>
            Log Out
          </button>
        )}
        <button className="buttons" onClick={() => navigate("/dfp1")}>
          Data
        </button>
        <DeleteAccount />
        <Clock />
        <TP1 />
      </div>

      <Alertp1 />

      <BarChart data={[]} />
    </div>
  );
}

export default Home1;
